  const clickBox = (id, buttonClicked) => {
    console.log("CLICKED button!!!!", id)
    buttonClicked = !buttonClicked
  }
  return (
    <div className="App">
      <h1>hello</h1>
      <Grid clickBox={clickBox} buttonClicked={buttonClicked}/>
    </div>
  );
}

export default App;
